import React, {Component} from "react"; 
import "./About.css";


class About extends Component {
    render(){
        return (
            <div className="About">
                <h1 className="About-title">About Me</h1>
                <p>Hello! I am JP Luncumilla, a certified web developer graduate at the Full Stack Web Development Program in The University of Miami. My front end skills consist of:</p>
            </div>
        )
    }
};

export default About;
